function FakeRequest(url){
    const decomposedUrl = url.split("/");
    const  arrSize= decomposedUrl.length;
    const start = Number(decomposedUrl[arrSize-2])-1;
    const limit= Number(decomposedUrl[arrSize-1]);
    
    const MOCK_DATA = getMockData();
    

    console.log(start, limit);

    let response=  new Promise((res, rej)=>{res(MOCK_DATA.slice(+start, +start+limit))});

  
    return response;

}




function treatment(data) {


    console.log("LLeuge");
    
    tbody.innerHTML = "";
    console.log(data);
    data.forEach(element => {
        let row = createLine(element);
        tbody.appendChild(row);
    });
}

function createLine(element) {
    let tr = document.createElement("tr");
    tableHead.forEach(element2 => {
        let td = document.createElement("td");
        td.innerHTML = element[element2];
        tr.appendChild(td);
    });

    return tr;

}




async function paginate() {
    const pageCant = document.getElementById("pageSize").value;
    try {
        const total = await getFakeTotal();
        const pageCount = Math.ceil(total / pageCant);
        createPaginationButtons(pageCount);
        loadPage(0);
        

    } catch (error) {
        console.log(error);
    }


}

